import React from "react";
import ReactDom from "react-dom";
import Card from "./App"
import details from "./Details"




// function webseries_cards(value,index,arr){
//     return (
//         <Card 
//             card_img = {value.card_img}
//             links = {value.links}
//             title = {value.title}
//             headname ={value.headname}
//         />
//     );
// }

const webseries_cards = (value,index,arr) =>{
    return (
        <card
        card_img = {value.card_img}
        links = {value.links}
        title = {value.title}
        headname ={value.headname}
        />
    );
}

ReactDom.render(
    <>
    <h1 className="head">LIST OF TOP 50 WEB SERIES</h1>
    </>,document.getElementById("root1")
); 



ReactDom.render(
    <>
    {details.map(value)}
    </>,document.getElementById("root2")
);
